function ValidMobileNum() {
    var regmobNo = /^(\d)(?!\1+$)\d*$/;
    var mobno = document.getElementById('<%=txtmobile1.ClientID %>').value;
    if (!regmobNo.test(mobno)) {
        alert('Please enter valid Mobile Number');

        document.getElementById('<%=txtmobile1.ClientID %>').value = "";
        return false;
    }
}





